import { ReactComponent as phyllo_logo } from "./phyllo_logo.svg";
import { ReactComponent as tiktokIcon } from "./tiktok_icon.svg";
import { ReactComponent as instagramIcon } from "./instagram_icon.svg";
import { ReactComponent as youtubeIcon } from "./youtube_icon.svg";
import { ReactComponent as twitchIcon } from "./twitch_icon.svg";
import { ReactComponent as twitterIcon } from "./twitter_icon.svg";
import { ReactComponent as facebookIcon } from "./facebook_icon.svg";
import { ReactComponent as otherPlatformsIcons } from "./add_other_platforms.svg";

export default {
  phyllo_logo,
  tiktokIcon,
  instagramIcon,
  youtubeIcon,
  twitchIcon,
  twitterIcon,
  facebookIcon,
  otherPlatformsIcons,
};
